import React from 'react';

const Refresh = ({onRefresh}) => {
    console.log("inside refresh",onRefresh);
    return (    
        <button className="refresh-button"  title="Click to Refresh" onClick={onRefresh}>
        Refresh
        </button>
    );
};

export default Refresh;
